import React from "react";
import { ArmiesTheme } from "../js/armiesPalette";

const getFill = (props) => {
    let color = ArmiesTheme.GRAY.main;
    let territories = props.territories;
    let card = props.card;
    let player = props.player;

    for(let i=0; i<territories.length; i++){
        if(territories[i].id === card.territoryId && territories[i].owner.id === player.id){
            color = ArmiesTheme[player.color].main;
            break;
        }
    }
    
    return color;
}

